import React from 'react';
import './shop.css';

class Shop extends React.Component{
	render(){
		return(
			<div>
				<div className="only">
					<div className="top">豆瓣&nbsp;豆品</div>
					<div className="bigchecked">
						<input type="checkbox"></input>
						<span>豆瓣豆品</span>
					</div>
					<hr />
					<div className="goods">
						<div className="good">
							
						</div>
					</div>
				</div>
			</div>
		)
	}
}

export default Shop;
